from typing import Optional, List
from pydantic import BaseModel
from fastapi import FastAPI

import requests as rq

class Inference(BaseModel):
    node_ip: str
    service_id: str
    model_id: str
    description: str
    data: str

app = FastAPI()

#example_data = {"image": ""}

@app.get("/")
async def load_balancer():
    return {"Hi": "Load Balancer"}

@app.post("/inference")
async def inference(inference: Inference):

    service = inference.service_id
    data = inference.data

    post_image = {"image": data}
    if service == "image-classification":
        x = rq.post("http://10.102.169.184:5001/inference", json=post_image)

#    if service == "object-detection":
#        x = rq.post("http://10.102.169.184:5001/inference", json=example_data)

    return x.json()


